function App() {
  return (
    <div>
      <Navigation />
      <div style={{margin:'0 10% 0 10%'}}>
        {/* <Home /> */}
        <div style={{width:'100px'}}>
        <EmbeddedTweet />
        </div>

        {/* <Movies /> */}
      </div>
      <Footer />
    </div>
  );
}
export default App;
